import React, {Component} from 'react';

class DetailsContainer extends Component{
	constructor(props){
		super(props);
	}

	render(){
		return (
			<div className="main-container">
		      	<div className="img-container">
		      	</div>
		      	<div className="details-container">
		      		<h2>
		      			{this.props.Name}
		      		</h2>
		      		<div className="owner-name">{this.props.OwnerName}</div>
		      		<div className="fork-count">{this.props.Fork}</div>
					<div className="star-count">{this.props.Star}</div>      		
		      	</div>
		     </div>
			);
	}
}

export default DetailsContainer;
